import React, {useEffect, useState} from 'react'

//Bootstrap
import Container from "react-bootstrap/Container";

function Stats(props) {
    console.log(props);

    return (
        <div className='stats'>
            <Container>
                {props.confirmed.country}
                {props.confirmed}
                {props.deaths}
                {props.recovered}
                <hr/>
            </Container>
        </div>
    )
}

export default  Stats
